  \"Rapid Ecological Assessment Methods for Forests in the Laurentian Mixed Forest-Great
  Lakes Coastal Biological Network, Midwest Region, National Wildlife Refuge System,
  US Fish & Wildlife Service Midwest Region - Survey Protocol Framework: First Edition
  (2014)\",\n\t\"tracking_summary\": {\n\t\t\"total\": 56,\n\t\t\"recent\": 1\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:44:31.180012\",\n\t\"name\":
  \"rapid-ecological-assessment-methods-for-forests-in-the-laurentian-mixed-forest-great-lakes\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This protocol framework provides guidance
  for conducting Inventories of forests at multiple stations within a region. During
  2010 and 2011, six refuges of the Laurentian Mixed Forestu2014Great Lakes Coastal
  Biological Network (hereafter, Great Lakes Biological Network) conducted assessments
  of their forests using methods outlined in the original field manual. Summary documents
  based on these data were finalized in 2012 (for an example see Goebel and Corace
  2012). On March 21, 2013 an email was sent to members of the National Wildlife Refuge
  System (NWRS) Division of Biological Resources (DBR) and to other NWRS colleagues
  requesting input and comments for improving the original field manual for use in
  future assessments or any other sampling done within forests of the Great Lakes
  Biological Network. Comments were received over the next six months, and this first
  edition of the regional survey protocol framework reflects those suggestions. Specifically,
  changes and clarifications were made in a number of areas, including the goals/objectives,
  sampling issues, the detail of observation in tree vigor, the dropping of damage
  classes, clarification with coarse woody debris (CWD) measurement and data use,
  how to measure saplings (midstory layer), and how to measure groundflora (groundcover).
  Useful comments were also received that suggested the integration of collected data
  into existing software such as the U.S. Forest Service Fire Effects and Monitoring
  and Inventory Protocol (FIREMON) and other software (e.g., T-Cruise, etc.). For
  copies of the detailed comments see the Appendices. These comments, and the input
  of other experienced professionals, will be invaluable in any future efforts to
  establish generalized regional or national protocols.\",\n\t\"license_title\": \"License
